document.addEventListener('DOMContentLoaded', () => {
  const infoBox    = document.getElementById('info-box'),
        gd         = document.querySelector('#plot-container .plotly'),
        group      = crosstalk.group('counties'),
        homeOrigin = '.modebar-btn[data-title^="resetCameraDefault3d"]',
        resetCont  = document.getElementById('resetViewContainer'),
        clearLink  = document.getElementById('clearLink');
  let initial;

  // 1) capture & lock initial camera + axes
  gd.on('plotly_afterplot', () => {
    if (!initial && gd.layout.scene) {
      initial = {
        cam: JSON.parse(JSON.stringify(gd.layout.scene.camera)),
        xr:  gd.layout.scene.xaxis.range.slice(),
        yr:  gd.layout.scene.yaxis.range.slice(),
        zr:  gd.layout.scene.zaxis.range.slice()
      };
      infoBox.style.display = 'none';
    }
  });

  // 2) clone the real Plotly “home” button into our sidebar
  const realHome = document.querySelector(homeOrigin);
  if (realHome) {
    const clone = realHome.cloneNode(true);
    clone.id = 'resetHome';
    // remove internal margins
    clone.style.margin = '0 0 8px 0';
    resetCont.appendChild(clone);
    realHome.style.display = 'none';  // hide original
  }

  // 3) shared reset routine
  function resetAll() {
    // clear selection
    group.clear();
    const sel = document.querySelector('#countyFilter select');
    if (sel) sel.selectize?.clear();
    // restore camera & axes
    Plotly.relayout(gd, {
      'scene.camera':      initial.cam,
      'scene.xaxis.range': initial.xr,
      'scene.yaxis.range': initial.yr,
      'scene.zaxis.range': initial.zr
    });
    // hide info
    infoBox.style.opacity   = '0';
    infoBox.style.maxHeight = '0';
    infoBox.style.display   = 'none';
    return false;
  }

  // 4) wire it up
  document.getElementById('resetHome')?.addEventListener('click', resetAll);
  clearLink.addEventListener('click', resetAll);

  // 5) info‐panel on hover & select
  function showInfo(lbl) {
    const v = lookup[lbl]; if (!v) return;
    infoBox.innerHTML = `<strong>${lbl}</strong><br><br>
      <ul style='margin:0;padding-left:16px;'>
        <li>Poverty rate       : ${v.poverty_rate}</li>
        <li>Owner-occupancy    : ${v.owner_rate}</li>
        <li>School index       : ${v.school_index}</li>
        <li>Clustering score   : ${v.clustering_county}</li>
        <li>Predicted τ̂ (USD) : ${v.predicted_tau}</li>
        <li>Cluster            : ${v.cluster}</li>
      </ul>`;
    infoBox.style.display   = 'block';
    infoBox.style.maxHeight = '400px';
    infoBox.style.opacity   = '1';
  }
  gd.on('plotly_hover',   e=> showInfo(e.points[0].text) );
  gd.on('plotly_unhover', ()=> infoBox.style.display='none' );
  group.on('selection',    keys=>{ if(keys?.length) showInfo(keys[0]); });
});
</script>
